parameters.functionCode:
const staticData = getWorkflowStaticData('global');

// Create a new set if it doesn't exist
if (!staticData.processed_ref_no) {
  staticData.processed_ref_no = new Set();
}

// Get the ref_no of all the items
const newListingIds = items.map(item => item.json["ref_no"]);

// Filter out items that have already been processed
const actualNewListing = items.filter((data) => {
  if (!staticData.processed_ref_no.has(data.json["ref_no"])) {
    // Add the ref_no to the set of processed items
    staticData.processed_ref_no.add(data.json["ref_no"]);
    return true;
  }
  return false;
});

return actualNewListing;

const staticData = getWorkflowStaticData('global');
const newListingIds = items.map(item => item.json["ref_no"]);
const oldListingIds = staticData.oldListingIds; 

if (!oldListingIds) {
  staticData.oldListingIds = newListingIds;
  return items;
}


const ActualNewListingIds = newListingIds.filter((id) => !oldListingIds.includes(id));
const actualNewListing = items.filter((data) => ActualNewListingIds.includes(data.json['ref_no']));
staticData.oldListingIds = [...ActualNewListingIds, ...oldListingIds];

return actualNewListing;
